import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { Link } from "react-router-dom";
const Project = () => {
  return (
    <div id="projects">
      <h4 className="font-bold text-lg lg:mt-10 ml-6 mt-40 md:ml- lg:ml-64 underline underline-offset-8 decoration-4 decoration-yellow-400">
        PROJECTS
      </h4>
      <div className="mt-5 mx-4 lg:mt-10 text-center grid grid-cols-1 lg:grid-cols-2 sm:grid:cols-2 hd gap-3  md:ml-70 sm:grid-cols-2 lg:ml-64">
        <div className="border-2 w-90 ml-19 border-500  hover:border-t-4 drop-shadow-md rounded-lg lg:h-56 ">
          <h2 className="">Todo App</h2>
          <p>A simple todo list for adding </p>
          <Link to=""></Link>
        </div>
        <div className=" hover:border-t-4 drop-shadow-lg hover:drop-shadow-md rounded-lg lg:8:56 ">
          <h2 className="">Surprise Planner</h2>
          <p>A blood group searching and donour app in your city</p>
          <p>This app was made with Java as Backend and XMl fronend</p>
        </div>
        <div className="border-2  border-500 hover:border-t-4 drop-shadow-lg hover:drop-shadow-md rounded-lg lg:h-56 ">
          <h2>Price Tracker</h2>
          <p>A python script which monitor price regular and when it comes below given amount it alert the user via email</p>
        </div>
      </div>
    </div>
  );
};
export default Project;
